        [Test]
        public void SerializeAndDesirializeTest()
        {
            var gameMap = new GameMap();
            for (int x = 0; x < GameMap.WIDTH; x++)
            {
                for (int y = 0; y < GameMap.HEIGHT; y++)
                {
                    gameMap.Map[x, y] = new Tile();
                }
            }

            gameMap.Map[3, 1].IsWall = true;
            var map = Serialize.Save(gameMap);
            Console.WriteLine(map);
            Console.WriteLine(gameMap.ShowMap());
        }

        [Test]
